DROP DATABASE IF EXISTS htmm;
CREATE DATABASE htmm;
USE htmm;
DROP TABLE IF EXISTS `events`;
CREATE TABLE IF NOT EXISTS `events` (
	`id`	INTEGER,
	`event_key`	TEXT,
	`process_key`	TEXT,
	`topic`	TEXT,
	`type`	TEXT,
	`action`	TEXT,
	`subject`	TEXT,
	`object`	TEXT,
	`status_type`	TEXT,
	`status_zed_code`	TEXT,
	`status_msg_code`	TEXT,
	`status_msg`	TEXT,
	`event_msg`	TEXT,
	`timestamp`	TEXT,
	PRIMARY KEY(`id`)
);
